import os
import pandas as pd
import yaml
import snowflake.connector
from cryptography.hazmat.backends import default_backend
from cryptography.hazmat.primitives import serialization
from datetime import date
today = date.today()
d1 = today.strftime("%Y%m%d")
print ("Today's date -->" , d1)
import sys
import warnings

with open(r'/obhdp/tcoc/p_scripts/python_tcoc.yaml') as file:
    config = yaml.load(file, Loader=yaml.FullLoader)

print(config)
snowFlakeInfo = config['accountname']
sandschema=config['schemaname']
dbname=config['dbname']


print("snowflake:--", snowFlakeInfo)
print("Schema:--" , sandschema)
print("dbname:--" , dbname)
print("user name: --->", config['username'])
print("Key path:--->", config['private_key_path'])


with open (config['private_key_path'], "rb") as key:
    p_key= serialization.load_pem_private_key(
        key.read(),
        password=config['passwordphrase'].encode(),
        backend=default_backend()
    )

pkb = p_key.private_bytes(
    encoding=serialization.Encoding.DER,
    format=serialization.PrivateFormat.PKCS8,
    encryption_algorithm=serialization.NoEncryption())

sf_conn = snowflake.connector.connect(
    account=config['accountname'],
    user=config['username'],
    private_key=pkb,
    role=config['rolename'],
    warehouse=config['warehousename'],
    database=config['dbname'],
    schema=config['schemaname']

)


diff_path = '/obhdp/tcoc/p_outbound/'


def execute_compare(query1, query2, tbname):
    try:

        print("Inside diff")
        df_sf = pd.read_sql(query1, con=sf_conn)
        df_sf = df_sf.reindex(sorted(df_sf.columns), axis=1)

        df_sf = df_sf.replace([None], [''], regex=True)
        df_sf = df_sf.fillna('')



        print("TableName -->", tbname)
        unix_table = tbname
        #command = "sh /obhdp/tcoc/p_scripts/OBH_Smart_Extraction_new.sh " + tbname
        sql_file="/obhdp/tcoc/p_scripts/" + tbname + ".sql"
        print(sql_file)
        file = open(sql_file, "w")
        file.write(query2)
        file.close()
        command = "sh /obhdp/tcoc/p_scripts/OBH_Smart_Extraction_non_user_id.sh PRD " + tbname + ".sql"
        print(command)
        os.system(command)
        read_file = "/obhdp_dev/tcoc/d_outbound/" + tbname + ".sql_" +  d1 + ".csv"

        df_ora = pd.read_csv(read_file, sep='|',keep_default_na=False)
        df_ora = df_ora.reindex(sorted(df_ora.columns), axis=1)
        df_ora = df_ora.replace([None], [''], regex=True)
        df_ora = df_ora.fillna('')
        # print(df_ora)

        df_diff = pd.concat([df_ora, df_sf], keys=['Oracle', 'Snowflake']).drop_duplicates(keep=False)
        df_diff.sort_index()

        print("difference size for " + tbname, df_diff.size )

        if (df_diff.size > 0):
             df_diff.to_csv(diff_path + tbname + '_Diffs.csv')

    except Exception as e:
        print(e, e.args)
        pass

